import React from "react";
import '../src/index.css';
import {NavLink} from "react-router-dom";

const Card=()=>{
    return (
        <>
            <div className="col-md-4 col-10 mx-auto">
                <div class="card">
                <img class="card-img-top" src="img1.jpg" alt="Card image cap"/>
                <div class="card-body">
                    <h5 class="card-title">Android</h5>
                    <p class="card-text">Android software development is the process by which applications are created for devices running the Android operating system. Google states that "Android apps can be written using Kotlin, Java, and C++ languages" using the Android software development kit, while using other languages is also possible</p>
                    <NavLink to="#" class="btn btn-primary">Go somewhere</NavLink>
                </div>
                </div>
            </div>
        </>
    );
}
export default Card;
